import Loader from "react-loader-spinner";
import { Component } from 'react'

class loader extends Component {
  //other logic
    render() {
    return (
        <div class>
    <Loader
        type="Puff"
        color="#00BFFF"
        height={100}
        width={100}
        margin={0}
        timeout={3000} //3 secs
    />
    </div>
    );
}
}
export default loader;
